import React from "react";
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';


function Header() {
  return (
    <div>
      <AppBar >
        <Toolbar>
          <h1 left>BHARAT</h1>
          

        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header;
